import React, { FC } from "react";
type FaqItem = {
  ques: string;
  ans1: string;
  ans2?: string;
  ansA?: string;
};

const FAQItem: FC<FaqItem> = ({ ques, ans1, ans2, ansA }) => {
  return (
    <div className="container">
      <details className="m-4 p-4 border rounded w-2/6 bg-stone-700 text-white cursor-pointer group">
        <summary className="list-none flex justify-between items-center font-medium text-lg">
          {ques}
          <svg
            viewBox="0 0 20 20"
            width={20}
            className="fill-white rotate-45 group-open:rotate-90 transition delay-75"
          >
            <g>
              <path d="M10.5 9.3L1.8 0.5 0.5 1.8 9.3 10.5 0.5 19.3 1.8 20.5 10.5 11.8 19.3 20.5 20.5 19.3 11.8 10.5 20.5 1.8 19.3 0.5 10.5 9.3Z"></path>
            </g>
          </svg>
        </summary>
        <p className="mt-3">
          {ans1}
          {ans2 || ansA ? <br /> : ""}
          {ans2 || ansA ? <br /> : ""}
          {ans2 ? ans2 : ""}
          {ansA ? <a href="#">ansA</a> + "." : ""}
        </p>
      </details>
    </div>
  );
};

export default FAQItem;
